// SPDX-License-Identifier: MIT
pragma solidity ^0.8.16;
import "../Crawl.sol";
import { ERC165 } from  '@openzeppelin/contracts/utils/introspection/ERC165.sol';
import { SafeMath } from '@openzeppelin/contracts/utils/math/SafeMath.sol';
import { Strings } from '@openzeppelin/contracts/utils/Strings.sol';

contract TestCrawl is ERC165 {
	using Strings for uint256;

	uint8 public _uint8;
	Crawl.ChamberData _chamber;

	constructor() {}

	function supportsInterface(bytes4 interfaceId) public view virtual override returns (bool) {
		// return interfaceId == type(MyInterface).interfaceId || super.supportsInterface(interfaceId);
		return super.supportsInterface(interfaceId);
	}

	event Event();

	//------------------------------
	// Direct access
	//
	function getOppositeTerrain(Crawl.Terrain terrain) public pure returns (Crawl.Terrain) {
		return Crawl.getOppositeTerrain(terrain);
	}
	function flipDir(Crawl.Dir dir) public pure returns (Crawl.Dir) {
		return Crawl.flipDir(dir);
	}
	function flipDoorPosition(uint8 doorPos, Crawl.Dir dir) public pure returns (uint8 result) {
		return Crawl.flipDoorPosition(doorPos, dir);
	}
	function makeCoord(uint64 north, uint64 east, uint64 west, uint64 south) public pure returns (uint256 result) {
		return Crawl.makeCoord(north, east, west, south);
	}
	function offsetCoord(uint256 coord, Crawl.Dir dir) public pure returns (uint256) {
		return Crawl.offsetCoord(coord, dir);
	}
	function getGemValue(Crawl.Gem gem) public pure returns (uint128) {
		return Crawl.getGemValue(gem);
	}
	function mapSeed(uint256 seed_, uint256 min_, uint256 maxExcl_) public pure returns (uint256) {
		return Crawl.mapSeed(seed_, min_, maxExcl_);
	}
	function mapSeedToBitmapPosition(uint256 seed_) public pure returns (uint8) {
		return Crawl.mapSeedToBitmapPosition(seed_);
	}
	function toHexStringBytes1(bytes1 value_) public pure returns (string memory) {
		return Crawl.toHexString(value_);
	}
	function toHexStringBytes(bytes memory value_) public pure returns (string memory) {
		return Crawl.toHexString(value_);
	}
	function toHexStringBytesLen(bytes memory value_, uint256 start_, uint256 length_) public pure returns (string memory) {
		return Crawl.toHexString(value_, start_, length_);
	}
	function coordsToString(uint256 coord, uint256 yonder, string memory separator) public pure returns (string memory) {
		return Crawl.coordsToString(coord, yonder, separator);
	}

	// Tools
