	function type_converts() public pure returns (bool) {
		// store uint256 as bytes (32 bytes)
		uint256 MAX = type(uint256).max;
		{
			bytes memory bs1 = new bytes(32);
			bs1 = abi.encode(MAX);
			uint256 ui1 = uint256(bytes32(bs1));
			require(ui1 == MAX, 'ui1 != MAX');
		}

		// 1 control byte + 32 bytes (33 bytes)
		uint8 CONTROL = 0xab;
		uint256 VALUE = MAX << 8;
		{
			bytes memory bs2 = new bytes(33);
			bs2 = abi.encodePacked(VALUE, CONTROL);
			uint256 ui2 = uint256(bytes32(bs2));
			uint8 ctrl2 = uint8(bs2[32]);
			require(ctrl2 == CONTROL, string(abi.encodePacked('ctrl2 (',Strings.toHexString(ctrl2),') != CONTROL (',Strings.toHexString(CONTROL),') : bs2[',bs2,']')));
			require(ui2 == VALUE, string(abi.encodePacked('ui2 (',Strings.toHexString(ui2),') != VALUE (',Strings.toHexString(VALUE),'): bs2[',bs2,']')));
		}

		{
			bytes[] memory bss = new bytes[](2);

			bss[0] = abi.encode(MAX);
			uint256 ui1 = uint256(bytes32(bss[0]));
			require(ui1 == MAX, 'ui1 != MAX');

			bss[1] = abi.encodePacked(VALUE, CONTROL);
			uint256 ui2 = uint256(bytes32(bss[1]));
			uint8 ctrl2 = uint8(bss[1][32]);
			require(ctrl2 == CONTROL, string(abi.encodePacked('ctrl2 (',Strings.toHexString(ctrl2),') != CONTROL (',Strings.toHexString(CONTROL),') : bss[',bss[1],']')));
			require(ui2 == VALUE, string(abi.encodePacked('ui2 (',Strings.toHexString(ui2),') != VALUE (',Strings.toHexString(VALUE),'): bss[',bss[1],']')));
		}

		return true;
	}

